import React, { useState, useEffect } from "react";
import Department from "./Department";
import "./List.css";

function List(props) {
  // List has departments
  const endpoint = 'http://127.0.0.1:8000/data';
  const [departments, setDepartments] = useState(null);

  useEffect(() => {
    (async () => {
      try {
        const response = await fetch(endpoint);
        const data = await response.json();

        // Check if data is an array before setting state
        if (Array.isArray(data)) {
          setDepartments(data);
        } else {
          console.error("Invalid data structure:", data);
        }
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    })();
  }, []);


  return (
    <div>
      {/* {departments ? departments.map((department) => (
        <Department key={department.id} name={department['name']} />
      )) : <p>Loading</p>} */}
      {departments?.map(department => JSON.stringify(department))}
      {JSON.stringify(departments[0]['name'])}
    </div>
  );
}

// Things get updated here

export default List;
